import 'bootstrap/dist/css/bootstrap.min.css';
import Footer from "examples/Footer";
import Aumtab2 from "layouts/pages/account/components/Aumtab2";
import aumdatatble2 from "layouts/authentication/error/aumdatatble2";

function Aumwise() {

  return (

    <Aumtab2 stickyNavbar>

      <SuiBox style={{ marginTop: '10px' }}>
        <Card id="change-password">
          <SuiBox p={1}>
            <DataTable table={aumdatatble2} entriesPerPage={false} canSearch />
          </SuiBox>
        </Card>
      </SuiBox>
      <Footer />
    </Aumtab2>
  );
}

export default Aumwise;
